
#include <gtest/gtest.h>
#include <gmock/gmock.h>

#include <vector>
#include <algorithm>

#include "algie/stable_matching.tpp"

using namespace std;

TEST(stable_matching_case, suite_1)
{
    unordered_map<string, vector<string> > M = {
        {"m1", {"w1", "w3", "w2"}},
        {"m2", {"w3", "w1", "w2"}},
        {"m3", {"w1", "w2", "w3"}}
    };

    unordered_map<string, vector<string> > W = {
        {"w1", {"m2", "m1", "m3"}},
        {"w2", {"m2", "m1", "m3"}},
        {"w3", {"m2", "m3", "m1"}}
    };
    
    vector< pair<string, string> > proper_res = {
        {"m1", "w1"}, {"m2", "w3"}, {"m3", "w2"}
    };
    
    vector< pair<string, string> > res;
    
    cppie::algie::stable_matching<string, string>(M, W, res);
    
    std::sort (proper_res.begin(), proper_res.end());  
    std::sort (res.begin(), res.end());  
    EXPECT_THAT(res, ::testing::ContainerEq(proper_res));
}

TEST(stable_matching_case, suite_2)
{
    unordered_map<string, vector<string> > M = {
        {"abe",     {"abi", "eve", "cath", "ivy", "jan", "dee", "fay", "bea", "hope", "gay"}},
        {"bob",     {"cath", "hope", "abi", "dee", "eve", "fay", "bea", "jan", "ivy", "gay"}},
        {"col",     {"hope", "eve", "abi", "dee", "bea", "fay", "ivy", "gay", "cath", "jan"}},
        {"dan",     {"ivy", "fay", "dee", "gay", "hope", "eve", "jan", "bea", "cath", "abi"}},
        {"ed",      {"jan", "dee", "bea", "cath", "fay", "eve", "abi", "ivy", "hope", "gay"}},
        {"fred",    {"bea", "abi", "dee", "gay", "eve", "ivy", "cath", "jan", "hope", "fay"}},
        {"gav",     {"gay", "eve", "ivy", "bea", "cath", "abi", "dee", "hope", "jan", "fay"}},
        {"hal",     {"abi", "eve", "hope", "fay", "ivy", "cath", "jan", "bea", "gay", "dee"}},
        {"ian",     {"hope", "cath", "dee", "gay", "bea", "abi", "fay", "ivy", "jan", "eve"}},
        {"jon",     {"abi", "fay", "jan", "gay", "eve", "bea", "dee", "cath", "ivy", "hope"}}
    };

    unordered_map<string, vector<string> > W = {
        {"abi",     {"bob", "fred", "jon", "gav", "ian", "abe", "dan", "ed", "col", "hal"}},
        {"bea",     {"bob", "abe", "col", "fred", "gav", "dan", "ian", "ed", "jon", "hal"}},
        {"cath",    {"fred", "bob", "ed", "gav", "hal", "col", "ian", "abe", "dan", "jon"}},
        {"dee",     {"fred", "jon", "col", "abe", "ian", "hal", "gav", "dan", "bob", "ed"}},
        {"eve",     {"jon", "hal", "fred", "dan", "abe", "gav", "col", "ed", "ian", "bob"}},
        {"fay",     {"bob", "abe", "ed", "ian", "jon", "dan", "fred", "gav", "col", "hal"}},
        {"gay",     {"jon", "gav", "hal", "fred", "bob", "abe", "col", "ed", "dan", "ian"}},
        {"hope",    {"gav", "jon", "bob", "abe", "ian", "dan", "hal", "ed", "col", "fred"}},
        {"ivy",     {"ian", "col", "hal", "gav", "fred", "bob", "abe", "ed", "jon", "dan"}},
        {"jan",     {"ed", "hal", "gav", "abe", "bob", "jon", "col", "ian", "fred", "dan"}}
    };
    
    vector< pair<string, string> > proper_res = {
        {"jon", "abi"}, {"fred", "bea"}, {"bob", "cath"}, {"col", "dee"}, {"hal", "eve"}, 
        {"dan", "fay"}, {"gav", "gay"}, {"ian", "hope"}, {"abe", "ivy"}, {"ed", "jan"}
    };
    
    vector< pair<string, string> > res;
    
    cppie::algie::stable_matching<string, string>(M, W, res);
    
    std::sort (proper_res.begin(), proper_res.end());  
    std::sort (res.begin(), res.end());  
    EXPECT_THAT(res, ::testing::ContainerEq(proper_res));
}

